import React, { useState } from 'react'

const AddCategory = () => {

    const [inputValue, setInputValue] = useState('Texto de ejemplo');

    return (
        <>
            <input
                type='text'
                value={inputValue}
            />
        </>
    )
}

export default AddCategory;
